import React from 'react';
import {Routes, Route} from 'react-router-dom';
import About from './About';
import Contact from './Contact';
const App = () => {
    return (
        <>
        <Routes>
            <Route path='about' component={About}/>
        </Routes>
        {/* <About />
        <Contact /> */}
        </>
    )
}

export default App;
